import React from 'react';
import {Helmet} from "react-helmet";
import logo from './logo.svg';
import './App.css';

const TITLE = 'Scroll Loop Menu | Zak Weiland'

function App() {
  return (
    <>
      <Helmet>
        <title>{ TITLE }</title>
      </Helmet>
      <div className="App">
        <header className="App-header">
          <p>
            Zak Weiland
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    </>
  );
}

export default App;
